import Layout from '../components/MyLayout';
import Link from 'next/link';
import fetch from 'isomorphic-unfetch';

const Index = props => (
  <Layout>
    <Link href="/p/[id]" as={`/p/${props.id}`}>
      <a>{props.id}</a>
    </Link>
  </Layout>
);
export default function Blog() {
  return (
    <Layout>
      <h1>My Blog</h1>
    </Layout>
  );
}
